webpackJsonp([39544687139854],{518:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Akka, Concurrency, etc.",author:"Richard Imaoka"}},markdownRemark:{id:"C:/Users/nishyu/richardimaoka/blog/src/pages/benchmarking-with-wrk-container/index.md absPath of file >>> MarkdownRemark",html:'<h2>Overview</h2>\n<ol>\n<li>wrk and Akka HTTP</li>\n<li>Dockerize wrk, with formatting tweaks</li>\n<li>Dockerize Akka HTTP </li>\n<li>Kubernetise wrk and akka http - next>? survey about local Kubernetes on Windows?</li>\n</ol>\n<p><a href="https://kubernetes.io/docs/getting-started-guides/minikube/">https://kubernetes.io/docs/getting-started-guides/minikube/</a></p>\n<p>command prompt with admin right</p>\n<p>eval $(minikube docker-env)\nC:\\WINDOWS\\system32>minikube docker-env\nSET DOCKER<em>TLS</em>VERIFY=1\nSET DOCKER<em>HOST=tcp://192.168.11.11:2376\nSET DOCKER</em>CERT<em>PATH=C:\\Users\\nishyu.minikube\\certs\nSET DOCKER</em>API_VERSION=1.23\nREM Run this command to configure your shell:\nREM @FOR /f “tokens=*” %i IN (‘minikube docker-env’) DO @%i</p>\n<p>docker images\nC:\\WINDOWS\\system32>docker images\nREPOSITORY                                    TAG                 IMAGE ID            CREATED             SIZE\nhello-node                                    v1                  3f944e08fa68        6 days ago          655MB\nalpine                                        3.4                 c7fc7faf8c28        2 months ago        4.82MB\nk8s.gcr.io/kubernetes-dashboard-amd64         v1.8.1              e94d2f21bc0c        3 months ago        121MB\ngcr.io/google-containers/kube-addon-manager   v6.5                d166ffa9201a        4 months ago        79.5MB\ngcr.io/k8s-minikube/storage-provisioner       v1.8.1              4689081edb10        4 months ago        80.8MB\nk8s.gcr.io/k8s-dns-sidecar-amd64              1.14.5              fed89e8b4248        6 months ago        41.8MB\nk8s.gcr.io/k8s-dns-kube-dns-amd64             1.14.5              512cd7425a73        6 months ago        49.4MB\nk8s.gcr.io/k8s-dns-dnsmasq-nanny-amd64        1.14.5              459944ce8cc4        6 months ago        41.4MB\nnode                                          6.9.2               faaadb4aaf9b        15 months ago       655MB\nk8s.gcr.io/nginx-slim                         0.8                 18ea23a675da        21 months ago       110MB\ngcr.io/google_containers/pause-amd64          3.0                 99e59f495ffa        23 months ago       747kB\nnginx                                         1.7.9               84581e99d807        3 years ago         91.7MB</p>\n<p>タグはlatest以外にする必要があることに注意。でないと、k8sはregistryからイメージをpullしてこようとしてしまいます。\n(<a href="http://kubernetes.io/docs/getting-started-guides/minikube/#reusing-the-docker-daemon">http://kubernetes.io/docs/getting-started-guides/minikube/#reusing-the-docker-daemon</a>)</p>\n<p>docker run myrepository:mytag\nENTRYPOINT: [command “entarg1” “entarg2”] # exec form\nCMD       : whatever\nRESULT    : command entarg1 entarg2 </p>\n<h1>CMD will be ignored</h1>\n<p>docker run myrepository:mytag arg1 arg2\nENTRYPOINT: [command “entarg1” “entarg2”] # exec form\nCMD       : whatever\nRESULT    : command entarg1 entarg2 arg1 arg2</p>\n<h1>arg1 arg2 will be apppeneded to ENTRYPOINT, and CMD will be overrided</h1>\n<p>docker run myrepository:mytag arg1 arg2\nENTRYPOINT: command entarg1 entarg2 # shell form\nCMD       : whatever\nRESULT    : command entarg1 entarg2 </p>\n<h1>ETRYPOINT in shell form prevents any CMD or run arguments from being used</h1>\n<p>docker run myrepository:mytag cmd</p>\n<p>docker run myrepository:mytag cmd arg1 arg2</p>',frontmatter:{title:"Benchmarking Akka HTTP with wrk containers",date:"March 11, 2018"}}},pathContext:{slug:"/benchmarking-with-wrk-container/"}}}});
